const NavBar = () => {
  return (
    <div>
      <ul>
        <li>
          <NavLink style={{ textDecoration: 'none' }} to="/">
            <NavItem>Home</NavItem>
          </NavLink>
        </li>
        <li>
          <NavLink style={{ textDecoration: 'none' }} to="/movies">
            <NavItem>Movies</NavItem>
          </NavLink>
        </li>
      </ul>
    </div>
  );
};

export default NavBar;
